import { useQuery, gql } from '@apollo/client';

const GET_STOCKS = gql`
  query GetStocks {
    stocks {
      date
      symbol
      exchange
      open
      high
      low
      close
      last
      volume
    }
  }
`;

export default GET_STOCKS;
